import React, {Component} from 'react';
import './Hello.css';

class Hello extends Component {
	render() {
		return (
		<div>
			<h1>Hello World</h1>
			<p>Welcome to React</p>
			<p>Lorem ipsum</p>
		</div>
		);
	}
}

export default Hello
